# **Overview of project**

# Our project aims to use both audio features and social media marketing features to predict popularity of a song. We would hence need first a dataset that determines popularity of a song. In our case we chose a binary classification type (is popular or not). We decided to use the infamous Billboard. Our primary focus revolves around identifying whether a song has ever reached the esteemed Global Hot 100 chart, a vital indicator of its popularity. This choice was based on the fact that Billboard really takes everything into account for the popularity of a song(Online streaming, physical CD sales, Concerts, music video, social media , radio etc…). This seemed to be the best accessible indicator of a song’s popularity.
# Now for the independent variables, we choose sets of data from various API sources(Spotify, Youtube and Billboard). For spotify, we are getting the audio features like (Tempo, danceability etc…), For Youtube, we are getting music video features like (Like count, view count etc…). The combination of all of these variables is justified by the versatility of the factors that makes a song popular. The song itself only will not determine its popularity.
# 

# In the following notebook, we are going to take you through the steps of data cleaning, data integretation and data analysis.  

